import styled from 'styled-components';

const Container = styled.div`
    font-size: 1.1rem;
`;

const date = new Date();
const hours = date.getHours();
const rightNow = date.toLocaleTimeString();

const Clock = () => <Container>{rightNow}</Container>;
export default Clock;
